import React, { ReactElement } from "react";

import { H3, H4 } from "../Typography";

type PropsType = {
  title: string;
  location: string;
  date: string;
  details: ReactElement;
};

const Entry = ({ title, location, date, details }: PropsType) => (
  <div>
    <div>
      <H3>{title}</H3>
      <h4>{location}</h4>
      <p>{date}</p>
    </div>
    <div>
      <p>{details}</p>
    </div>
  </div>
);

export default Entry;
